DROP TABLE IF EXISTS mbti_100;
CREATE TABLE mbti_100
(
    name	VARCHAR(512) PRIMARY KEY,
    personality	VARCHAR(512),
    total_votes	INT,
    first_letter_votes_percentage	VARCHAR(512),
    second_letter_votes_percentage	VARCHAR(512),
    third_letter_votes_percentage	VARCHAR(512),
    fourth_letter_votes_percentage	VARCHAR(512)
);

